data.method:
if(params["accountID2"] == 0)
{
	params["accountID2"] = row["account_id"];
}

if(params["accountID2"]!=row["account_id"])
{
	params["index"] = 0;
	params["accountID2"] = 0;
}

params["index"]++;

if(params["accountID"] == 0)
{
	params["accountID"] = row["account_id"];
}

if(params["accountID"]!=row["account_id"])
{
	params["accountID"] = row["account_id"];
	params["isFirstRecord"] = true;
}

if(params["isFirstRecord"])
{
	params["balance"] = row["curr_val"]+row["trans_amt"];
	params["isFirstRecord"] = false;
}
else
{
	params["balance"] = params["balance"]+row["trans_amt"];
}
